void MAdp_MFC_SetTCONPowerOff(void)
{
    pthread_mutex_lock(&MFC_mutex);
    MDrv_MFC_SetSerialDebug(TRUE);
    ////
    // Pwm0,1 duty 0% output
	MDrv_MFC_WriteByteMask(0x1E40 , 0, 0x03); //PWM_OEN
    mfcSleepMs(20);

    // Inverter off
//please add here.....
    mfcSleepMs(200);

    //GCLK1,2,3,4,5,6 off
    mfcSleepMs(30);
    MDrv_MFC_WriteBit(0x238C, _ENABLE, _BIT4); // GCLK6
    MDrv_MFC_WriteBit(0x238C, _ENABLE, _BIT6); // GCLK5
    MDrv_MFC_WriteBit(0x237E, _ENABLE, _BIT5); // GCLK4
    MDrv_MFC_WriteBit(0x236E, _ENABLE, _BIT5); // GCLK3
    MDrv_MFC_WriteBit(0x235E, _ENABLE, _BIT5); // GCLK2
    MDrv_MFC_WriteBit(0x234E, _ENABLE, _BIT5); // GCLK1

    //VST off
    MDrv_MFC_WriteBit(0x238C, _ENABLE, _BIT2); // VST
    mfcSleepMs(30);

    //VDD Even/Odd off
    MDrv_MFC_WriteBit(0x23C8, _ENABLE, _BIT4); // VGH_EVEN
    MDrv_MFC_WriteBit(0x23D2, _ENABLE, _BIT4); // VGH_ODD
    mfcSleepMs(30);

    //DPM off
    MDrv_MFC_WriteBit(0x1E1A, _DISABLE, _BIT1); // DPM
    mfcSleepMs(20);

    //POL/SOE off
    MDrv_MFC_WriteBit(0x23F5, _ENABLE, _BIT2); // POL
    MDrv_MFC_WriteBit(0x23F5, _ENABLE, _BIT3); // SOE
    mfcSleepMs(20);

    //Panel Power 12V off
//please add here.....

    ///
    MDrv_MFC_SetSerialDebug(FALSE);
    pthread_mutex_unlock(&MFC_mutex);
}

