{
    U8 reg2C42, reg1E3D;
    pthread_mutex_lock(&MFC_mutex);
    MDrv_MFC_SetSerialDebug(TRUE);

    reg2C42=MDrv_MFC_ReadByte(0x2C42);
    reg1E3D=MDrv_MFC_ReadByte(0x1E3D);

    MDrv_MFC_SetSerialDebug(FALSE);
    pthread_mutex_unlock(&MFC_mutex);

    if((reg2C42&0x1f)!=2 && reg1E3D<2)
        return TRUE;
    else
        return FALSE;
}


